window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"19.1.2","implementation":{"name":"cucumber-jvm","version":"7.8.0"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.5+8"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1685739532,"nanos":376378100}}},{"source":{"uri":"classpath:features/RetailOrder.feature","data":"@order\nFeature: Retail Order Page\n\n  Background: \n    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'zatwr@gmail.com' and password 'Kabuljan@123'\n    And User click on login button\n    And User should be logged in into Account\n\n  @test1\n  Scenario: Verify User can add an item to cart\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on Search icon\n    And User click on the item\n    And User select quantity ‘2’\n    And User click add to Cart button\n    Then the cart icon quantity should change to‘2’\n\n  @test2\n  Scenario: Verify User can place an order with Shipping address and payment Method on file\n    And User change the category to 'Electronics'\n    And User search for an item Apex Legends 'Apex Legends'\n    And User click on Search icon\n    And User click on item\n    And User select Apex Legends quantity ‘5’\n    And User click add cart button\n    Then the cart icon quantity Apex Legends should change to ‘5’\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    And User click on Place Your Order\n    Then a message should be displayed 'Order Placed, Thanks'\n\n  @Regression\n  Scenario: Verify User can cancel the order\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Cancel The Order button\n    And User select the cancelation Reason ‘Bought wrong item’\n    And User click on Cancel Order button\n    Then a cancelation message should be displayed ‘Your Order Has Been Cancelled’\n\n  @Regression\n  Scenario: Verify User can Return the order\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Return Items button\n    And User select the Return Reason ‘Item damaged’\n    And User select the drop off service ‘FedEx’\n    And User click on Return Order button\n    Then a cancelation message should be displayed ‘Return was successful’\n\n  @Regression\n  Scenario: Verify User can write a review on order placed\n    And User click on Orders section\n    And User click on first order in list\n    And User click on Review button\n    And User write Review headline ‘ headline value’ and ‘review text’’\n    And User click Add your Review button\n    Then a review message should be displayed ‘Your review was added successfully’\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@order","id":"cadad4f2-9b62-4768-b64c-772d8fab11d2"}],"language":"en","keyword":"Feature","name":"Retail Order Page","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"84892445-7ea1-4df5-a6f1-a8c9c4ea1280"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"a14e871d-abb1-44d3-b1e7-eb2b8b24ef98"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'zatwr@gmail.com' and password 'Kabuljan@123'","id":"f53aba49-3f70-437e-b550-f96d649c3a5d"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"9a0a9c61-8127-4832-b824-6697579c01a9"},{"location":{"line":9,"column":5
